import React, { useState, useContext, createContext } from "react";
import Header from "./components/header.jsx";
import Changer from "./components/timelineChanger.jsx";
import Ages from "./components/ages.jsx";

const Page = () => {
  const [slider, setSlider] = useState(1);
  const ValueContext = createContext(slider);

  function changeSliderVal(val) {
    setSlider(val);
  }

  return (
    <div>
      <Header />
      <Changer handleChange={(event, val) => changeSliderVal(val)} />
      <>{slider}</>
      <div>
        <ValueContext.Provider value={slider}>
          {/* <Ages/> */}
        </ValueContext.Provider>
      </div>
    </div>
  );
};

export default Page;
